      through a clear and conspicuous request on the original solicitation and a follow
      up - stand alone effort no later than 30 days after the receipt of the contribution.  The
      amended report provides missing information since obtained.   3. Schedule H1
      has been amended to reflect the correct fix allocation percentage.  Despite
      the orginal June Monthly Report Schedule H1 reporting a 21% federal/79% nonfederal
      allocation, the Committee allocated all administrative costs at the correct
      36% federal/64% nonfederal ratio.  There were no overpayments by our non-federal
